  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains field and genetic
  identification of rougheye (Sebastes aleutianus) and blackspotted (Sebastes melanostictus)
  rockfish collected during AFSC bottom trawl surveys.  There is considerable difficulty
  in correctly distinquishing between these species of rockfish in the field.  The
  database contains the field identification of each specimen, genetic identification
  (true species identification) along with biological information for each specimen
  including weight, length, and age.  Also included is the location and water depth
  where each specimen was collected.\",\n\t\"license_title\": null,\n\t\"extras\":
